export const attachmentTypeImage = {
  dir: 'data:image/svg+xml;base64,',
  jpg: 'data:image/svg+xml;base64,',
  png: 'data:image/svg+xml;base64,',
  gif: 'data:image/svg+xml;base64,',
  doc: 'data:image/svg+xml;base64,',
  docx: 'data:image/svg+xml;base64,',
  xlsx: 'data:image/svg+xml;base64,',
  xls: 'data:image/svg+xml;base64,',
  pdf: 'data:image/svg+xml;base64,',
  zip: 'data:image/svg+xml;base64,',
  tar: 'data:image/svg+xml;base64,',
  'tar.gz': 'data:image/svg+xml;base64,',
  '7z': 'data:image/svg+xml;base64,',
  rar: 'data:image/svg+xml;base64,',
  exe: 'data:image/svg+xml;base64,',
  txt: 'data:image/svg+xml;base64,',
  mp3: 'data:image/svg+xml;base64,',
  avi: 'data:image/svg+xml;base64,',
  wmv: 'data:image/svg+xml;base64,',
  mp4: 'data:image/svg+xml;base64,',
  mov: 'data:image/svg+xml;base64,',
  html: 'data:image/svg+xml;base64,',
  js: 'data:image/svg+xml;base64,',
  css: 'data:image/svg+xml;base64,',
  java: 'data:image/svg+xml;base64,',
  vue: 'data:image/svg+xml;base64,',
  unknown: 'data:image/svg+xml;base64,'
}

export const getThumbnail = extension => {
  var fileThumbnail = attachmentTypeImage[extension]
  if (!fileThumbnail) {
    fileThumbnail = attachmentTypeImage['unknown']
  }
  return fileThumbnail
}
